import React from "react";

function MatchTypeSelector() {
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        <div className="col-4">
          <h6>Register Match</h6>
        </div>
        <div className="col-1"></div>
        <div className="col-2"></div>
        <div className="col-3">
          <h6>Match Stats</h6>
        </div>
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
